      SELECT DISTINCT - 12 AS col0 FROM tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab1
  - name: tab2

outputs:
  - name: q9234.out
    data: |
      -12
